import React from 'react';
import Styles from './User.module.css';
const User= ()=>{
    return (
        <form>
            <div className={Styles.input}>
                <label>Username</label>
                <input type="text" ></input>
            </div>
            <div className={Styles.input}>
                <label>Age (Years)</label>
                <input type="text" ></input>
            </div>
        </form>
    )
}

export default User;
